import SlotsAvailable from './components/SlotsAvailable';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css'

class App extends Component {
  render() {
    const [selectedDate, setSelectedDate]= useState(null)
  return (
    <div className="App">
      <DatePicker selected = {selectedDate} onChange = {date=> setSelectedDate(date)}></DatePicker> 
      <SlotsAvailable time ="3:00 pm" noofslots="10 Available slots"/><SlotsAvailable time ="3:30 pm" noofslots="10 Available slots"/> 
      <SlotsAvailable time ="4:00 pm" noofslots="10 Available slots"/>
      <SlotsAvailable time ="4:30 pm" noofslots="10 Available slots"/>
      </div>

    );
  }
}

export default App;
